var $bm_rt;
var f, phase_start, character_delay_param, character_delay_index, character_delay_param, character_delay_index, character_delay, t, t, t, w, bounce_num, t, y, decay, h;
f = effect('Bounce Frequency')(1);
phase_start = $bm_div(effect('Bounce Start')(1), 100);
character_delay_param = effect('Bounce Per-Character Delay')(1).value;
character_delay_index = $bm_sub(textIndex, 1);
if (character_delay_param < 0) {
    character_delay_param = $bm_neg(character_delay_param);
    character_delay_index = $bm_sub(textTotal, textIndex);
}
character_delay = $bm_mul(character_delay_param, character_delay_index);
t = $bm_sub($bm_mul(time, f), character_delay);
if (t < 0) {
    t = 0;
}
t = $bm_sum(t, phase_start);
w = 2;
bounce_num = Math.floor($bm_div(t, w));
t = $bm_mod(t, w);
y = $bm_mul(t, $bm_sub(w, t));
decay = $bm_div(effect('Bounce Decay')(1), 100);
h = Math.pow(decay, bounce_num);
$bm_rt = $bm_sum($bm_neg(h), $bm_mul($bm_mul(h, y), selectorValue));
